import React from 'react';

const API_KEY = `${process.env.REACT_APP_GOOGLE_API_KEY}`

class BeachCard extends React.Component {

  state = {
    address: null,
  }

  componentDidMount() {
    if (this.props.beach.place_id) {
      return fetch(`https://maps.googleapis.com/maps/api/place/details/json?place_id=${this.props.beach.place_id}_M&key=AIzaSyDA0kZdff9Oi6T6PM7nKwVG92c3uELsbRE`)
        .then( r => r.json())
        .then( data => {
          console.log("data", data)
        })
    }

  }


  render () {
    console.log("beach card", this.props)
    return (
      <div className="Beach-Card" onClick={() => {this.props.selectBeach(this.props.beach.name)}}>
        <ul class="nobull">
          <li>{this.props.beach.name}</li>
          <li>Location: {this.props.beach.vicinity}</li>
          <li>Address: </li>
        </ul>
      </div>
    )
  }

}
export default BeachCard
